import React from "react";
import { Tile } from "./Tile";

export const TileList = ({ data }) => {
  if (!data || data.length === 0) {
    return <div>No data available</div>;
  }

  return (
    <div>
      {data.map((item, index) => (
        <Tile key={index} data={item} />
      ))}
    </div>
  );
};
